import { Container } from "react-bootstrap";
import { Header } from './components/Header/Header';
import { Routes, Route } from "react-router-dom";
import { Home } from './components/Home/Home';

const App = () => {
  return (
    <Container>
      <Header/>
      <Routes>
        <Route path='/' element={<Home />} />
      </Routes>
    </Container>
  )
}

export default App;
